var do_type={init:function(){for(var t=document.querySelectorAll(".do_type"),e=0;e<t.length;e++)t[e].style="border-right: 2px solid #333;padding-right: 4px;"},replay:function(t){var e=document.querySelector(t);setTimeout(function(){e.innerHTML="",do_type.type(t)},3e3)},type:function(t){var e=document.querySelector(t);try{var r=e.getAttribute("title"),n=e.getAttribute("title").length}catch(t){return void console.log("no attribute")}e.innerText="",r.replace(" ","-");var o=0,i=setInterval(function(){o>=n-1&&(clearInterval(i),do_type.replay(t)),"*"==r[o]?(e.innerHTML+="<br>",r[o]=""):e.innerHTML+="<span>"+r[o]+"</span>",o++},150)}};do_type.init();
